import styled from 'styled-components';

function Nav() {
    return (
        <NavStyle>
            <ul>
                <li>
                    <a href="/sub/html">html</a>
                </li>
                <li>
                    <a href="/sub/css">css</a>
                </li>
                <li>
                    <a href="/sub/js">js</a>
                </li>
            </ul>
        </NavStyle>
    );
}

const NavStyle = styled.nav`
    ul {
        display: flex;
    }
    a {
    }
`;

export default Nav;
